const Sources = () => {

    return(
        <>
        <div class="bodyDiv">
        <p>Souces: <br></br>
        <a href="https://www.doi.gov/blog/10-tips-prevent-wildfires">US Department of Interior - Wildfire Prevention Info</a>
        <br></br>

        <a href="https://earth.org/what-causes-wildfires/">Earth.org - What Causes Wildfires</a>
